import React, { useEffect, useState } from 'react'
import BuyData from "../Buy/Json/Buy.json"

export default function Buy({ buy }) {
  let g = JSON.parse(localStorage.getItem("b"))
  const [Card, setCard] = useState(g===null ? BuyData.Card:g.Card)
 
  return (
    <div className='Buy' >
      <div className="Buy_title">
      Buy_title_box
        <span><h2>Summa</h2>: <h2>$ 400</h2></span>
        <button>To'lov</button>
      </div>
      
      <div className="Buy_cards">
        {
          Card.map((value, key) => (
            <div key={key} className="Cards_cards_items" id={value.id}>
              <img src={value.img} alt="" />
              <div className="Cards_cards_items_title">
                <h4>{value.CardTitle}</h4>
