                      <path d="M9.92623 24.2108L0 18.3529L9.92017 32.3373L19.8515 18.3529L9.92017 24.2108H9.92623ZM10.0738 0L0.151576 16.4683L10.0738 22.3363L20 16.4743L10.0738 0Z" fill="#FE8235" />
                    </svg>

                  </span>
                  <p>  o.452.46</p>
                </h6>
                <span>
                  <img src={value.ellipseimg} alt="" />
                  <p>{value.name}</p>
                </span>
                <div className="btn">
                  <button  >Bay</button>
                </div>

              </div>
            </div>


          ))



        }
      </div>

    </div>
  )
}


